import React from "react";
import "./Weather.css";

export default function Weather(){
    return (
        <div className="Weather">
            <h1>Tokyo</h1>
            <ul>
                <li>Wednesday 09:00</li>
                <li>Mostly cloudy</li>
            </ul>
            </div>
    )
 }
